        "desc": "Notes: This is a tune by Jim Reed, one of the BHO's most talented pickers and contributors. Banjo Hell is the name of our campsite at the Appalachian String Band Festival held every summer at Clifftop, West Virginia.  I tabbed this out based upon a recorded performance from Jim's CD, Jim Reed, Family and Friends.  Jim's banjo is tuned f#DGAD, a tuning that Dock Boggs used once in awhile.  I have also seen Jim play this tune with the banjo tuned aDGAD.  He never picks anything twice the same way."
