        "desc": "Notes: Here is my version of a classic tune by Bill Monroe and Kenny Baker, normally played in the key of A (capoed up two).  The breaks involve a judicious mixture of Scruggs and melodic playing.  Pay particular attention to the third break, in which I attempt to capture the feel of Kenny Baker's approach to the tune on the fiddle.  Ah, Kenny Baker."
