        "desc": "Notes: Tuning gEADE\nI have made a minor change in the way I play the tune, since my 1978 tab was published. I now play the first two notes as a drop thumb, index on open 1st string, to thumb while fingering the 4th fret on the 2nd string. This change is also at the end of the 4th measure where the phrase repeats. I hope you all will not have trouble with the old Banjo Newsletter tab form in which the numbers appear in the spaces. In my tab, I've corrected the incorrect tuning, in that it was printed backwards in the Banjo Newsletter in 6/78."
