        "desc": "Notes: \"Bright Sunny South,\" based on the version by Dock Boggs, but presented here in thumb lead 2 finger picking style.  I included the right hand fingering for the first part of the tune.  Basically, the index finger plays the 1st string, and the thumb plays all others.  My version of this tune is constantly changing.  I use variations of this style through different verses, sometimes even including thumb/index pinched notes rather than rolls.  The tuning is gDGCD."
