        "desc": "Notes: I wrote this after the birth of my first child, in the 1970s.  \"Katy Hill\" was the starting point for the tune, and I wanted to see how far I could depart from the original without getting too crazy.  I used to play it in Vancouver, British Columbia, with my band Silver Spring, named after the delightful local beer we drank at practices.  The Silver Spring Brewery (of Victoria, B.C.) was eventually bought by Labatt's, and the beer morphed into Lucky Lager, decidedly a step down from Silver Spring.  But I digress ..."
