        "desc": "Notes: I have this exact tab recorded note-for-note in the BHO music files, played to a piano backing track so that I could put in bass movement and chords in order for the syncopated figures to be heard against the normal downbeats and strong beats. I also play this with a considerable amount of swing (bounce) which gives the tune an even more syncopated feeling. This is a cakewalk, similar to ragtime, though it could be sped up and played as a driving breakdown (see other tab). Playing tip: as tempo increases, the more the bounce (degree of swing) tends to even out. The focus here is to demonstrate syncopation and accenting in Scruggs-style picking. Big thanks to Taj Mahal for this lovely tune."
