        "desc": "Notes: DM is a wonderful old fiddle tune that arises in many jams.  My arrangement is based in part on Butch Robins's recording and in part on an obscure tape of Bill Keith playing it in a jam at Roland White's house in 1968.  I have to warn you that it might be Vic Jordan playing banjo on the White tape, because he recorded a similar arrangement on his solo album a few years later.  However, to me it sounds like Keith's playing and Keith's banjo.  In any case, I tabbed it out in G, but to accommodate the fiddle and mandolin you would normally capo up 2 and play it in the key of A."
