        "desc": "Notes: Here is a three-finger version of Fiddling Around. The TablEdit file contains both banjo and guitar, while the pdf version only shows the banjo (and the guitar chords). The tab is based on a transcription from the fiddle version in David Brody's The Fiddler's Fakebook. The first part is rather banjo friendly, but the second part contains some \"shuffling\" which can be played in several other ways on the banjo. Just use your own imagination and work out something own if you feel for it."
