        "desc": "Notes: These are finger warm up exercises based on ones I used to do for guitar.  Play *slowly*, with metronome or play along with Tabledit, until you can play them perfectly.  If you're making mistakes as you play, you're playing it fast. Increase speed gradually over time.  I did this with standard G tuning, which is how it sounds best, but this is about fingering, not melody, so technically the tuning of your banjo doesn't matter."
