        "desc": "Notes: Qu\u00e9b\u00e9cois tune from the Olympia Quebecois session repertoire. From the repertoire of Bertrand Deraspe. Henry Wadsworth Longfellow wrote Evangeline in 1847 as a tragic but fictional account of two lovers, Evangeline and Gabriel, who were separated on their wedding day during the expulsion of the Acadians from Acadie (present-day Nova Scotia, Canada). In the poem, Evangeline spends much of her life wandering North America in search of her lost love. The real Acadian exiles were also heartbroken from being forced from their homes."
