        "desc": "Notes: An Irish jig transformed into a CH banjo reel.\nIt is normally played in D-mixolydian (D scale with C-natural), but I tabbed it in \"triple-C\" tuning, so you'd capo up one step to get to D.\n\nThe triple C tuning seem good for the drones of these piping tunes. Adding extra beats to the jig to change it from 6/8 time to 4/4 time \"americanizes\" the tune. One BHO member even said it seems \"bluesy\"."
