        "desc": "Notes: This is a tab of Billy Faier's Green Corn. It is played by clawhammer or Pete Seeger's \"basic strum\" but with a little different stroke pattern and use of alternate hammer-on and pull off on the fourth string:\n1 a. Strike any string (1st to fourth) with the index finger (or middle finger if you prefer)\n1 b. Hammer on the forth strong on second fret (and keep the string fretted)\n2 a. Brush down with the hand (or a finger if you prefer)\n2 b. Thumb the fifth string\n3 a. Pull off the fourth string\n3 b. Strike any string (1st to fourth) with the index finger (or middle finger if you prefer.\n4 a. Hammer on the forth strong on second fret\n4 b. Pull off the fourth string"
