        "desc": "Notes: This tune is simple but catchy. I wrote if for my best friend, Guido (pronounced Gee-doh with a hard G).  Its in open G, with a capo on the second fret (aEAC#E) and I classified it as 'intermediate' because it has a few instances of drop thumb, but its really pretty easy to play. If you make a recording, let me know! :) Daniyel"
