        "desc": "Notes: I miss playing all of those wonderful exercises by C.L. Hanon for Piano.  These exercises were intended to build accuracy, speed, finger strength, and endurance.  Recently, I finally decided to convert one of them to tab for banjo. Play slowly, with metronome or with Tabledit until you can play them perfectly, then gradually increase speed over time. Unlike with the piano, you can move the exercise down the neck if you want to increase finger stretching."
