        "desc": "Notes: During the discussion in summer 2009 about whether it really was Earl playing on the radio recording of \"I'll Fly Away\" that was posted on BHO, one BHO member suggested that the rest of us post our versions of the song. Being a cooperative person, I posted a recent version of mine, and this is the tablature for it, more or less.  My version incorporates a little bit of a salute to the mystery player we have all agonized about -- and if you saw the video of Earl playing \"I'll Fly Away\" at Nat Winston's, you will probably agree that the mystery player on the tape is indeed Earl Scruggs. Also, near the end, it includes a tip of the hat to Bill Keith."
