        "desc": "Notes: Inspired by Noam Pikelny's bluegrass version of Kenny Baker's classic fiddle arrangement, I undertook to get as close as I could to Baker's arrangement using the clawhammer style in a G modal (or Sawmill) tuning, capoed at the second fret and fifth string capoed up to an A."
