        "desc": "Notes: This is a Qu\u00e9b\u00e9cois tune, written in the 1930s by Joe Bouchard [no - not the Blue Oyster Cult bassist, but a Jos\u00e9ph Bouchard, of Quebec] that I thought could benefit from a banjo arrangement. I originally thought it was a Cajun tune, as I first heard it by Steve Riley and the Mamou Playboys on their fantastic album \"Trace of Time\". This arrangement is a transcription (more or less) of Dave Greeley's 1st fiddle solo from that recording. It's not terrifically easy but is attainable - and it sounds great when you get it up and running! Have fun."
