        "desc": "Notes: Here is a sample tab of the G major scale and C major scale for banjo.  The question of scales comes up often, so this demonstrates my approach to teaching scales.  You may play scales on single strings.  However, that doesn't have much practical application for bluegrass playing.  The idea is to play rolls, so, I believe scales should be practiced that way.  Here is the simple rule to follow:  never play the same string twice in a row; never use the same finger twice in a row."
