        "desc": "Notes: My tab comprises two breaks, the first close to Earl Scruggs's and the second more improvisational.  Scruggs's break is one of the most straightforward and elegant of his early recordings with the Foggy Mountain Boys, and I love it.  If you take a listen to the Foggies' recording, note that they tuned their instruments up a half step.  Hence they sound like they are playing in G#, although they are playing out of G position."
