        "desc": "Notes: \"O Holy Night\" (\"Cantique de No\u00ebl\") is a well-known Christmas carol composed by Adolphe Adam in 1847 to the French poem \"Minuit, chr\u00e9tiens\" (Midnight, Christians) by Placide Cappeau (1808\u20131877). Cappeau, a wine merchant and poet, had been asked by a parish priest to write a Christmas poem. Unitarian minister John Sullivan Dwight, editor of Dwight's Journal of Music, created a singing edition based on Cappeau's French text in 1855.\n\nIt is also very popular in Sweden, and when making this arrangement I listened a lot to an old recording by the old Swedish tenor singer Jussi Bj\u00f6rling."
