        "desc": "Notes: Redwing is a nice simple tune that is common in jams.  However, for some reason it was never immediately obvious to me how to find the melody of the B part of Redwing.  You could say that I had trouble winging it.  Anyway, eventually I sat down and worked the B part up quite deliberately.  The first break is pretty straight Scruggs style, whereas the second break is more improvisational."
