        "desc": "Notes: The first song written by the famous Irish harpist Turlough O'Carolan (1670 - 1738), the translated title means Big Hill, Little Hill and the lyrics described a battle between two fairy groups.  The composition was so remarkable that it began a lifetime as a successful bard in the days when harpists traveled from manor to manor, earning their living providing entertainment."
