        "desc": "Notes: Second String D-Tuner:\nHigh Stop: \"C\" Note\nLower Stop: \"B\" Note\n\nBetween the first break and the second break, you must quickly tune the second string down from a \"C\" note to a \"B\" note and leave it there for the duration of the second break.\n\nAfter the second break, quickly tune the second string from the \"B\" note back up to the \"C\" note.\n\nBecause I could not figure out how to put all banjo breaks on one module, they are split between breaks. All breaks should be played by one banjo and see notes in the tab to understand how to play the song."
