        "desc": "Notes: Here is a bluegrass arrangement of \u201cOver the Rainbow,\u201d often referred to as \u201cSomewhere Over the Rainbow.\u201d  I play it in the key of C, standard G tuning, although some versions I have heard (e.g., Eddie Shelton\u2019s) are in the key of G.  But I think C works better on the banjo.  I am aware that there are alternate chord structures for this tune, particularly for the B part.  This version works for me, but your mileage may vary, and feel free to come up with your own arrangement."
